INSERT INTO `block_custom` (`bid`, `body`, `info`, `format`) VALUES
(1, 'We are a team of committed professionals who have come up to serve people who face difficulty in any of their work done. We are a Delhi based organization which aims to provide you the best solutions according to your budget and other conveniences. As we are a young & new start up, we do not have any high- end apps and many services but soon we will be expanding our services ‘catalogue and digitizing the entire database. For us, Customer Satisfaction is the main concern that is why we are launching only a few important services so that people can remain satisfied. Currently we are only providing services in Delhi but soon we will be reaching to NCR and in future plan to reach other cities.', 'Who Are We?', 'filtered_html'),
(2, 'KK Team- 09873300718, 09810326449\r\nT-69, Pocket 7, Jasola Vihar, New Delhi-110025', 'Contact us', 'full_html'),
(3, 'Sit Back and Relax, Our team will take care of your worries, We are just a call away! ', 'text', 'filtered_html'),
(4, 'KK Team- 09873300718, 09810326449\r\nT-69, Pocket 7, Jasola Vihar, New Delhi-110025', 'Contact', 'filtered_html'),
(5, 'Welcome to Kaamkaro.com. If you continue to browse and use this website, you are agreeing to comply with and be bound by the following terms and conditions of use, which together with our privacy policy govern relationship with you in relation to this website. If you disagree with any part of these terms and conditions, please do not use our website.\r\nThe term Kaamkarao or ''us'' or ''we'' refers to the owner of the website whose registered office is T-69, Pocket 7, Jasola Vihar, and New Delhi – 110025. The term ''you'' refers to the user or viewer of our website.\r\nThe use of this website is subject to the following terms of use:\r\nThe content of the pages of this website is for your general information and use only. It is subject to change without notice.\r\nWe take your details purely for business purposes and we do not share your contact details with any other person or company. \r\nNeither we nor any third parties provide any warranty or guarantee as to the accuracy, timeliness, performance, completeness or suitability of the information and materials found or offered on this website for any particular purpose. You acknowledge that such information and materials may contain inaccuracies or errors and we expressly exclude liability for any such inaccuracies or errors to the fullest extent permitted by law.\r\nYour use of any information or materials on this website is entirely at your own risk, for which we shall not be liable. It shall be your own responsibility to ensure that any products, services or information available through this website meet your specific requirements.\r\nThis website contains material which is owned by or licensed to us. This material includes, but is not limited to, the design, layout, look, appearance and graphics. Reproduction is prohibited other than in accordance with the copyright notice, which forms part of these terms and conditions.\r\nAll trademarks reproduced in this website which are not the property of, or licensed to, the operator are acknowledged on the website.\r\nUnauthorised use of this website may give rise to a claim for damages and/or be a criminal offence.\r\nFrom time to time this website may also include links to other websites. These links are provided for your convenience to provide further information. They do not signify that we endorse the website(s). \r\nWe are a firm with so many service providers attached to us, once you requests for s service, we send a team of professionals to you and then you may talk to each other regarding the services required. \r\nWe have a minimum order policy against every order. For example, tailors are not sent to mere take an order of one shirt or printer may not be sent home to get 50 page book printed. Though we do not expect you to give a bulk order but as our firm is a start up, we may not be able to do justice with the quality that we promise to deliver and the service provider to whom we will send to you. However , in case of very small orders, we may give you the contact details of the service providers and you may get in touch with them. \r\nThough we have a trusted network of people but we request you to not give service providers a complete freedom in order to protect your privacy and safety.\r\nIf (in case) you are not satisfied with the service provided by the person we have sent you, you may call us in between the service or even after the work is completed. We assure you to provide best solutions amicably and mutually. \r\nIf (in case) you feel that our worker does not have the requisite expertise, then you may need not to use our services and send him back only by paying visit charges (which are very minimal), if you go ahead and some mishap (in case) takes place while using their services, then Kaamkarao shall not be hold responsible. For example, If you get your car serviced through our channel and after a few days, you discovered a problem in your car, then we shall not be held responsible for that. \r\nHowever, we have hired the trained and qualified professionals whose aim is never to discomfort you but rather to build a mutual relationship for times to come.\r\nWe request you to always collect a receipt from the service provider and in the absence of that you should at least have a copy of an email from Kaamkarao team. In the absence of either, you are not liable to claim for any service.\r\nIn an event where you would like to reuse the service directly from the service provider by not taking us in the loop, the entire responsibility shall remain with you and the vendor but not with us. \r\nIn case you make a call and we confirm it and you abort the request, you will have to bear the minimum visit charges. ( in case people carrying heavy machinery with them, you will have to pay for their transportation if you cancel in between) \r\n', 'T & C', 'filtered_html'),
(6, 'Copyright © 2016 KaamKarao.com', 'Copyright', 'filtered_html'),
