INSERT INTO `field_data_body` (`entity_type`, `bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `body_value`, `body_summary`, `body_format`) VALUES
('node', 'page', 0, 1, 1, 'und', 0, 'We are a team of committed professionals who have come up to serve people who face difficulty in any of their work done. We are a Delhi based organization which aims to provide you the best solutions according to your budget and other conveniences.  As we are a young & new start up, we do not have any high- end apps and many services but soon we will be expanding our services ‘catalogue and digitizing the entire database. For us, Customer Satisfaction is the main concern that is why we are launching only a few important services so that people can remain satisfied.  Currently we are only providing services in Delhi but soon we will be reaching to NCR and in future plan to reach other cities.\r\n\r\nWe are a firm with so many service providers attached to us, once you requests for s service, we send a team of professionals to you and then you may talk to each other regarding the services required. \r\nWe have a minimum order policy against every order. For example, tailors are not sent to mere take an order of one shirt or printer may not be sent home to get 50 page book printed. Though we do not expect you to give a bulk order but as our firm is a start up, we may not be able to do justice with the quality that we promise to deliver and the service provider to whom we will send to you. However , in case of very small orders, we may give you the contact details of the service providers and you may get in touch with them. \r\nThough we have a trusted network of people but we request you to not give service providers a complete freedom in order to protect your privacy and safety.\r\n', '', 'filtered_html'),
('node', 'page', 0, 2, 2, 'und', 0, 'How was your experience? \r\nOn a scale of 1-5 (where 1 is very poor and 5 is very good) \r\nWhat improvements you want?\r\nWhat services you want us to add? \r\nEg. Plumber, Marriage Bureau, Laundry etc. ', '', 'filtered_html'),
('node', 'page', 0, 3, 3, 'und', 0, 'KK Team- 09873300718, 09810326449\r\nT-69, Pocket 7, Jasola Vihar, New Delhi-110025', '', 'filtered_html'),
('node', 'page', 0, 4, 4, 'und', 0, '<p>Welcome to Kaamkaro.com. If you continue to browse and use this website, you are agreeing to</p>\r\n\r\n<p>comply with and be bound by the following terms and conditions of use, which together with our</p>\r\n\r\n<p>privacy policy govern relationship with you in relation to this website. If you disagree with any</p>\r\n\r\n<p>part of these terms and conditions, please do not use our website.</p>\r\n\r\n<p>The term Kaamkarao or &amp;#39;us&amp;#39; or &amp;#39;we&amp;#39; refers to the owner of the website whose registered office is</p>\r\n\r\n<p>T-69, Pocket 7, Jasola Vihar, and New Delhi – 110025. The term &amp;#39;you&amp;#39; refers to the user or</p>\r\n\r\n<p>viewer of our website.</p>\r\n\r\n<p>The use of this website is subject to the following terms of use:</p>\r\n\r\n<ul>\r\n	<li>&nbsp;The content of the pages of this website is for your general information and use only. It is subject to change without notice.</li>\r\n	<li>We take your details purely for business purposes and we do not share your contact details with any other person or company.</li>\r\n	<li>Neither we nor any third parties provide any warranty or guarantee as to the accuracy, timeliness,performance, completeness or suitability of the information and materials found or offered on this website for any particular purpose. You acknowledge that such information and materials may contain inaccuracies or errors and we expressly exclude liability for any such inaccuracies or errors to the fullest extent permitted by law.</li>\r\n	<li>Your use of any information or materials on this website is entirely at your own risk, for which we shall not be liable. It shall be your own responsibility to ensure that any products, services or information available through this website meet your specific requirements.</li>\r\n	<li>This website contains material which is owned by or licensed to us. This material includes, but is not limited to, the design, layout, look, appearance and graphics. Reproduction is prohibited other than in accordance with the copyright notice, which forms part of these terms and conditions.</li>\r\n	<li>All trademarks reproduced in this website which are not the property of, or licensed to, the operator are acknowledged on the website.</li>\r\n	<li>Unauthorised use of this website may give rise to a claim for damages and/or be a criminal offence.</li>\r\n	<li>From time to time this website may also include links to other websites. These links are provided for your convenience to provide further information. They do not signify that we endorse the website(s).</li>\r\n	<li>We are a firm with so many service providers attached to us, once you requests for s service, we send a team of professionals to you and then you may talk to each other regarding the services required.</li>\r\n	<li>We have a minimum order policy against every order. For example, tailors are not sent to mere take an order of one shirt or printer may not be sent home to get 50 page book printed. Though we do not expect you to give a bulk order but as our firm is a start up, we may not be able to do justice with the quality that we promise to deliver and the service provider to whom we will send to you. However , in case of very small orders, we may give you the contact details of the service providers and you may get in touch with them.</li>\r\n	<li>Though we have a trusted network of people but we request you to not give service providers a complete freedom in order to protect your privacy and safety.</li>\r\n	<li>If (in case) you are not satisfied with the service provided by the person we have sent you, you may call us in between the service or even after the work is completed. We assure you to provide best solutions amicably and mutually.</li>\r\n	<li>If (in case) you feel that our worker does not have the requisite expertise, then you may need not to use our services and send him back only by paying visit charges (which are very minimal), if you go ahead and some mishap (in case) takes place while using their services, then Kaamkarao shall not be hold responsible. For example, If you get your car serviced through our channel and after a few days, you discovered a problem in your car, then we shall not be held responsible for that.</li>\r\n	<li>However, we have hired the trained and qualified professionals whose aim is never to discomfort you but rather to build a mutual relationship for times to come.</li>\r\n	<li>We request you to always collect a receipt from the service provider and in the absence of that you should at least have a copy of an email from Kaamkarao team. In the absence of either, you are not liable to claim for any service.</li>\r\n	<li>In an event where you would like to reuse the service directly from the service provider by not taking us in the loop, the entire responsibility shall remain with you and the vendor but not with us.</li>\r\n	<li>In case you make a call and we confirm it and you abort the request, you will have to bear the minimum visit charges. ( in case people carrying heavy machinery with them, you will have to pay for their transportation if you cancel in between)</li>\r\n</ul>\r\n', '', 'filtered_html'),
('node', 'page', 0, 5, 5, 'und', 0, '<p><strong>What we collect</strong></p>\r\n\r\n<p>We may collect the following information:</p>\r\n\r\n<ul>\r\n	<li>name and job title</li>\r\n	<li>contact information including email address</li>\r\n	<li>demographic information such as postcode, preferences and interests</li>\r\n	<li>other information relevant to customer surveys and/or offers</li>\r\n</ul>\r\n\r\n<p><strong>What we do with the information we gather</strong></p>\r\n\r\n<p>We require this information to understand your needs and provide you with a better service, and</p>\r\n\r\n<p>in particular for the following reasons:</p>\r\n\r\n<ul>\r\n	<li>&nbsp;Internal record keeping.</li>\r\n	<li>&nbsp;We may use the information to improve our products and services.&nbsp;We may periodically send promotional emails about new products, special offers or other</li>\r\n	<li>information which we think you may find interesting using the email address which youhave provided.</li>\r\n	<li>&nbsp;From time to time, we may also use your information to contact you for market researchpurposes. We may contact you by email, phone, fax or mail. We may use the informationto customise the website according to your interests.</li>\r\n</ul>\r\n\r\n<p><strong>Security</strong></p>\r\n\r\n<p>We are committed to ensuring that your information is secure. In order to prevent unauthorised</p>\r\n\r\n<p>access or disclosure, we have put in place suitable physical, electronic and managerial</p>\r\n\r\n<p>procedures to safeguard and secure the information we collect online.</p>\r\n\r\n<p><strong>How we use cookies</strong></p>\r\n\r\n<p>A cookie is a small file which asks permission to be placed on your computer&amp;#39;s hard drive. Once</p>\r\n\r\n<p>you agree, the file is added and the cookie helps analyse web traffic or lets you know when you</p>\r\n\r\n<p>visit a particular site. Cookies allow web applications to respond to you as an individual. The</p>\r\n\r\n<p>web application can tailor its operations to your needs, likes and dislikes by gathering and</p>\r\n\r\n<p>remembering information about your preferences.</p>\r\n\r\n<p>We use traffic log cookies to identify which pages are being used. This helps us analyse data</p>\r\n\r\n<p>about web page traffic and improve our website in order to tailor it to customer needs. We only</p>\r\n\r\n<p>use this information for statistical analysis purposes and then the data is removed from the</p>\r\n\r\n<p>system.</p>\r\n\r\n<p>Overall, cookies help us provide you with a better website, by enabling us to monitor which</p>\r\n\r\n<p>pages you find useful and which you do not. A cookie in no way gives us access to your</p>\r\n\r\n<p>computer or any information about you, other than the data you choose to share with us.</p>\r\n\r\n<p>You can choose to accept or decline cookies. Most web browsers automatically accept cookies,</p>\r\n\r\n<p>but you can usually modify your browser setting to decline cookies if you prefer. This may</p>\r\n\r\n<p>prevent you from taking full advantage of the website.</p>\r\n\r\n<p><strong>Links to other websites</strong></p>\r\n\r\n<p>Our website may contain links to other websites of interest. However, once you have used these</p>\r\n\r\n<p>links to leave our site, you should note that we do not have any control over that other website.</p>\r\n\r\n<p>Therefore, we cannot be responsible for the protection and privacy of any information which you</p>\r\n\r\n<p>provide whilst visiting such sites and such sites are not governed by this privacy statement. You</p>\r\n\r\n<p>should exercise caution and look at the privacy statement applicable to the website in question.</p>\r\n\r\n<p><strong>Controlling your personal information</strong></p>\r\n\r\n<p>You may choose to restrict the collection or use of your personal information in the following</p>\r\n\r\n<p>ways:</p>\r\n\r\n<ul>\r\n	<li>&nbsp;whenever you are asked to fill in a form on the website, look for the box that you can marketing purposes</li>\r\n	<li>&nbsp;if you have previously agreed to us using your personal information for direct marketingpurposes, you may change your mind at any time by writing to or emailing us at [email address]</li>\r\n</ul>\r\n\r\n<p>We will not sell, distribute or lease your personal information to third parties unless we have</p>\r\n\r\n<p>your permission or are required by law to do so. We may use your personal information to send</p>\r\n\r\n<p>you promotional information about third parties which we think you may find interesting if you</p>\r\n\r\n<p>tell us that you wish this to happen.</p>\r\n\r\n<p>You may request details of personal information which we hold about you under the Data</p>\r\n\r\n<p>Protection Act 1998.</p>\r\n\r\n<p>If you believe that any information we are holding on you is incorrect or incomplete, please write</p>\r\n\r\n<p>to or email us as soon as possible, at the above address. We will promptly correct any</p>\r\n\r\n<p>information found to be incorrect.</p>\r\n\r\n<p><strong>Disclaimer</strong></p>\r\n\r\n<ul>\r\n	<li>You will not use this website for illegal purposes.</li>\r\n	<li>You will not use company’s Name, logo, trademark, and content as they are the property of owner. No replication is allowed for users in any way.</li>\r\n	<li>You will not copy, translate, reproduce, distribute, modify &amp;amp; circulate anything without prior written permissions.</li>\r\n	<li>&nbsp;You will not propagate any material which is harmful for the users or the domain in any way.</li>\r\n	<li>&nbsp;You will not interfere, disrupt and do anything which compromises the security of this website.</li>\r\n	<li>You will only use this website for seeking information, only for personal use and not for any other commercial benefit.</li>\r\n	<li>&nbsp;You will not float any junk, spam or unsolicited mails on the website, doing that will terminate your account.</li>\r\n	<li>&nbsp;You are adhering to provide your complete details for the registration on the website,feeding wrong or incomplete information will be seen as non-compliance to the website policies.</li>\r\n</ul>\r\n\r\n<p><strong>Information from third parties</strong></p>\r\n\r\n<ul>\r\n	<li>&nbsp;The other social media integration has been facilitated for providing the users an interface where they can make their opinions and comments accessible to each other in much more convenient way.</li>\r\n	<li>&nbsp;Your use of other websites will be entirely at your own risk and you will be responsible and accountable for the content you write.</li>\r\n	<li>&nbsp;Kaamkarao.com does not support or endorse the accuracy or reliability of any information, content of advertisements contained, distributed through, or linked, downloaded from the services and businesses contained on this website. It does not endorse the quality of any services, products, information or materials displayed, purchased, or obtained by you as a result of an advertisement or any other information.</li>\r\n</ul>\r\n\r\n<p><strong>Damages</strong></p>\r\n\r\n<ul>\r\n	<li>Kaamkarao.com is not responsible for any loss, erasure, or corruption of User&amp;#39;s computer,data or files whatsoever.</li>\r\n	<li>Users must use the website at their own risk and by any malicious attack or any virus attack, the website should not be held responsible.</li>\r\n	<li>You should not intend to make any loss to the reputation or goodwill of the website or the company by demeaning or maligning the organisation or the owner, doing so will act in a pursuant of legal case of defamation.</li>\r\n</ul>\r\n\r\n<p><strong>Termination of Use</strong></p>\r\n\r\n<ul>\r\n	<li>If a user violates any of the agreements, then the editor holds the complete discretion for suspending the account.</li>\r\n	<li>Any breach of the above said agreements will lead to removal of the content posted by an individual.</li>\r\n	<li>Kaamkarao.com reserves all rights to discontinue, lay off their operations at any point of time. They will not be bound to preserve any data comprising any sort of information.</li>\r\n</ul>\r\n\r\n<p><strong>Jurisdiction</strong></p>\r\n\r\n<p>If any part of this Agreement is determined to be invalid or unenforceable pursuant to applicable</p>\r\n\r\n<p>law including, but not limited to, the warranty disclaimers and liability limitation set forth above,</p>\r\n\r\n<p>then the invalid or unenforceable provision will be deemed superseded by a valid, enforceable</p>\r\n\r\n<p>provision that most closely matches the intent of the original provision and the remainder of the</p>\r\n\r\n<p>Agreement shall continue in effect. All disputes subject to Delhi’s Jurisdiction.</p>\r\n\r\n<p>Every effort is made to keep the website up and running smoothly. However, Kaamkaro.com</p>\r\n\r\n<p>takes no responsibility for, and will not be liable for, the website being temporarily unavailable</p>\r\n\r\n<p>due to technical issues beyond our control.</p>\r\n', '', 'filtered_html'),
('node', 'article', 0, 6, 6, 'und', 0, 'We provide Teachers who will teach your children complete Quran with its meaning and importance. You can also customize the pack after speaking to our team. ', '', 'filtered_html'),
('node', 'article', 0, 7, 7, 'und', 0, 'If you are fed up of calling a cab service which charges way too much or if you have a car but does not know how to drive or does not even want to drive then call us, we will get you a driver for a day, week, month etc.* You can customize the required services according to your needs.\r\n\r\n\r\n*Yet ,we do not have drivers to drive fully automoatic cars, so kindly excuse us for this but soon we will provide you with them. ', '', 'filtered_html'),
('node', 'article', 0, 8, 8, 'und', 0, 'Bored of the same interiors of your house? Can you shift the double bed or Almira alone? If you feel that packers and movers is too expensive and unfeasible for your work, then call us and we will send you a team of heavy duty labor who would happily help re-arranging your stuff? We have a large base of unskilled and skilled labours that would come very useful for any kind of work which you cannot do it due to scarcity of time and energy. Our team has a network of Carpenters, Painters, Masons, Foreman and Construction workers. You may let us know 1 day in advance that how many people are required? ', '', 'filtered_html'),
('node', 'article', 0, 9, 9, 'und', 0, 'Fed up of picking your CPU/laptop  and wasting your time taking it to Nehru Place, Leave it there, we will come, pick it up and return it safely at your doorstep post repair. ', '', 'filtered_html'),
('node', 'article', 0, 10, 10, 'und', 0, 'We have a tie up with reputed printing firms of Delhi and all you need to do is to talk to our person and he will take care of everything. \r\n', '', 'filtered_html'),
('node', 'article', 0, 11, 11, 'und', 0, 'Thinking of getting your thesis typed? Relax! We have a team of dedicated people who would assist you in typing of your project.', '', 'filtered_html'),
('node', 'article', 0, 12, 12, 'und', 0, 'Is your daughter getting? Or you have to throw a small budget party to your school friends? All such questions make us worried? But now leave it on our team! From food & Beverages * ( veg+ non veg) to decoration , From catering to other miscellaneous management, our team will take care of all your worries. Now you just make a list of guests and rest we will be there with you. \r\n\r\n*- We do not serve Porks and Alcohol (However you will get the entire menu from our representative)', '', 'filtered_html'),
('node', 'article', 0, 13, 13, 'und', 0, 'Get your car services by trained professionals within an affordable price. We will pick your car, repair it and return it. You don’t need to stand in queues with job sheets to get your own car serviced or to even buy an accessory. ', '', 'filtered_html'),
('node', 'article', 0, 14, 14, 'und', 0, 'Traffic in Delhi has made our lives so difficult that we want everything at home, From a Pizza to a wrist watch; we never want to move out. However our sisters and mothers ‘visits to tailors never end till the last moment. If you don’t want to be the driver (cum brother of the bride), just call our tailor at your home and he will take care of everything. ', '', 'filtered_html'),
('node', 'article', 0, 27, 27, 'und', 0, 'We have a team of professional content writers, who would help you to write content for your annual reports, website content, commercial publicity materials etc. ', '', 'filtered_html');
