(1, 'node', ' about us we are a team of committed professionals who have come up to serve people who face difficulty in any of their work done we are a delhi based organization which aims to provide you the best solutions according to your budget and other conveniences as we are a young new start up we do not have any high end apps and many services but soon we will be expanding our services catalogue and digitizing the entire database for us customer satisfaction is the main concern that is why we are launching only a few important services so that people can remain satisfied currently we are only providing services in delhi but soon we will be reaching to ncr and in future plan to reach other cities we are a firm with so many service providers attached to us once you requests for s service we send a team of professionals to you and then you may talk to each other regarding the services required we have a minimum order policy against every order for example tailors are not sent to mere take an order of one shirt or printer may not be sent home to get 50 page book printed though we do not expect you to give a bulk order but as our firm is a start up we may not be able to do justice with the quality that we promise to deliver and the service provider to whom we will send to you however in case of very small orders we may give you the contact details of the service providers and you may get in touch with them though we have a trusted network of people but we request you to not give service providers a complete freedom in order to protect your privacy and safety  ', 0),
(2, 'node', ' help us to serve you better how was your experience on a scale of 15 where 1 is very poor and 5 is very good what improvements you want what services you want us to add eg plumber marriage bureau laundry etc  ', 0),
(3, 'node', ' contact us kk team 9873300718 9810326449 t69 pocket 7 jasola vihar new delhi110025  ', 0),
(4, 'node', ' terms and conditions welcome to kaamkarocom if you continue to browse and use this website you are agreeing to comply with and be bound by the following terms and conditions of use which together with our privacy policy govern relationship with you in relation to this website if you disagree with any part of these terms and conditions please do not use our website the term kaamkarao or 39 us 39 or 39 we 39 refers to the owner of the website whose registered office is t69 pocket 7 jasola vihar and new delhi 110025 the term 39 you 39 refers to the user or viewer of our website the use of this website is subject to the following terms of use the content of the pages of this website is for your general information and use only it is subject to change without notice we take your details purely for business purposes and we do not share your contact details with any other person or company neither we nor any third parties provide any warranty or guarantee as to the accuracy timeliness performance completeness or suitability of the information and materials found or offered on this website for any particular purpose you acknowledge that such information and materials may contain inaccuracies or errors and we expressly exclude liability for any such inaccuracies or errors to the fullest extent permitted by law your use of any information or materials on this website is entirely at your own risk for which we shall not be liable it shall be your own responsibility to ensure that any products services or information available through this website meet your specific requirements this website contains material which is owned by or licensed to us this material includes but is not limited to the design layout look appearance and graphics reproduction is prohibited other than in accordance with the copyright notice which forms part of these terms and conditions all trademarks reproduced in this website which are not the property of or licensed to the operator are acknowledged on the website unauthorised use of this website may give rise to a claim for damages and or be a criminal offence from time to time this website may also include links to other websites these links are provided for your convenience to provide further information they do not signify that we endorse the website s we are a firm with so many service providers attached to us once you requests for s service we send a team of professionals to you and then you may talk to each other regarding the services required we have a minimum order policy against every order for example tailors are not sent to mere take an order of one shirt or printer may not be sent home to get 50 page book printed though we do not expect you to give a bulk order but as our firm is a start up we may not be able to do justice with the quality that we promise to deliver and the service provider to whom we will send to you however in case of very small orders we may give you the contact details of the service providers and you may get in touch with them though we have a trusted network of people but we request you to not give service providers a complete freedom in order to protect your privacy and safety if in case you are not satisfied with the service provided by the person we have sent you you may call us in between the service or even after the work is completed we assure you to provide best solutions amicably and mutually if in case you feel that our worker does not have the requisite expertise then you may need not to use our services and send him back only by paying visit charges which are very minimal if you go ahead and some mishap in case takes place while using their services then kaamkarao shall not be hold responsible for example if you get your car serviced through our channel and after a few days you discovered a problem in your car then we shall not be held responsible for that however we have hired the trained and qualified professionals whose aim is never to discomfort you but rather to build a mutual relationship for times to come we request you to always collect a receipt from the service provider and in the absence of that you should at least have a copy of an email from kaamkarao team in the absence of either you are not liable to claim for any service in an event where you would like to reuse the service directly from the service provider by not taking us in the loop the entire responsibility shall remain with you and the vendor but not with us in case you make a call and we confirm it and you abort the request you will have to bear the minimum visit charges in case people carrying heavy machinery with them you will have to pay for their transportation if you cancel in between  ', 0),
(5, 'node', ' privacy policy what we collect we may collect the following information name and job title contact information including email address demographic information such as postcode preferences and interests other information relevant to customer surveys and or offers what we do with the information we gather we require this information to understand your needs and provide you with a better service and in particular for the following reasons internal record keeping we may use the information to improve our products and services we may periodically send promotional emails about new products special offers or other information which we think you may find interesting using the email address which youhave provided from time to time we may also use your information to contact you for market researchpurposes we may contact you by email phone fax or mail we may use the informationto customise the website according to your interests security we are committed to ensuring that your information is secure in order to prevent unauthorised access or disclosure we have put in place suitable physical electronic and managerial procedures to safeguard and secure the information we collect online how we use cookies a cookie is a small file which asks permission to be placed on your computer 39 s hard drive once you agree the file is added and the cookie helps analyse web traffic or lets you know when you visit a particular site cookies allow web applications to respond to you as an individual the web application can tailor its operations to your needs likes and dislikes by gathering and remembering information about your preferences we use traffic log cookies to identify which pages are being used this helps us analyse data about web page traffic and improve our website in order to tailor it to customer needs we only use this information for statistical analysis purposes and then the data is removed from the system overall cookies help us provide you with a better website by enabling us to monitor which pages you find useful and which you do not a cookie in no way gives us access to your computer or any information about you other than the data you choose to share with us you can choose to accept or decline cookies most web browsers automatically accept cookies but you can usually modify your browser setting to decline cookies if you prefer this may prevent you from taking full advantage of the website links to other websites our website may contain links to other websites of interest however once you have used these links to leave our site you should note that we do not have any control over that other website therefore we cannot be responsible for the protection and privacy of any information which you provide whilst visiting such sites and such sites are not governed by this privacy statement you should exercise caution and look at the privacy statement applicable to the website in question controlling your personal information you may choose to restrict the collection or use of your personal information in the following ways whenever you are asked to fill in a form on the website look for the box that you can marketing purposes if you have previously agreed to us using your personal information for direct marketingpurposes you may change your mind at any time by writing to or emailing us at email address we will not sell distribute or lease your personal information to third parties unless we have your permission or are required by law to do so we may use your personal information to send you promotional information about third parties which we think you may find interesting if you tell us that you wish this to happen you may request details of personal information which we hold about you under the data protection act 1998 if you believe that any information we are holding on you is incorrect or incomplete please write to or email us as soon as possible at the above address we will promptly correct any information found to be incorrect disclaimer you will not use this website for illegal purposes you will not use company s name logo trademark and content as they are the property of owner no replication is allowed for users in any way you will not copy translate reproduce distribute modify amp circulate anything without prior written permissions you will not propagate any material which is harmful for the users or the domain in any way you will not interfere disrupt and do anything which compromises the security of this website you will only use this website for seeking information only for personal use and not for any other commercial benefit you will not float any junk spam or unsolicited mails on the website doing that will terminate your account you are adhering to provide your complete details for the registration on the website feeding wrong or incomplete information will be seen as noncompliance to the website policies information from third parties  the other social media integration has been facilitated for providing the users an interface where they can make their opinions and comments accessible to each other in much more convenient way your use of other websites will be entirely at your own risk and you will be responsible and accountable for the content you write kaamkaraocom does not support or endorse the accuracy or reliability of any information content of advertisements contained distributed through or linked downloaded from the services and businesses contained on this website it does not endorse the quality of any services products information or materials displayed purchased or obtained by you as a result of an advertisement or any other information damages kaamkaraocom is not responsible for any loss erasure or corruption of user 39 s computer data or files whatsoever users must use the website at their own risk and by any malicious attack or any virus attack the website should not be held responsible you should not intend to make any loss to the reputation or goodwill of the website or the company by demeaning or maligning the organisation or the owner doing so will act in a pursuant of legal case of defamation termination of use if a user violates any of the agreements then the editor holds the complete discretion for suspending the account any breach of the above said agreements will lead to removal of the content posted by an individual kaamkaraocom reserves all rights to discontinue lay off their operations at any point of time they will not be bound to preserve any data comprising any sort of information jurisdiction if any part of this agreement is determined to be invalid or unenforceable pursuant to applicable law including but not limited to the warranty disclaimers and liability limitation set forth above then the invalid or unenforceable provision will be deemed superseded by a valid enforceable provision that most closely matches the intent of the original provision and the remainder of the agreement shall continue in effect all disputes subject to delhi s jurisdiction every effort is made to keep the website up and running smoothly however kaamkarocom takes no responsibility for and will not be liable for the website being temporarily unavailable due to technical issues beyond our control  ', 0),
(6, 'node', ' learn quran we provide teachers who will teach your children complete quran with its meaning and importance you can also customize the pack after speaking to our team  ', 0),
(7, 'node', ' hire a driver if you are fed up of calling a cab service which charges way too much or if you have a car but does not know how to drive or does not even want to drive then call us we will get you a driver for a day week month etc you can customize the required services according to your needs yet we do not have drivers to drive fully automoatic cars so kindly excuse us for this but soon we will provide you with them  ', 0),
(8, 'node', ' skilled and unskilled labor bored of the same interiors of your house can you shift the double bed or almira alone if you feel that packers and movers is too expensive and unfeasible for your work then call us and we will send you a team of heavy duty labor who would happily help rearranging your stuff we have a large base of unskilled and skilled labours that would come very useful for any kind of work which you cannot do it due to scarcity of time and energy our team has a network of carpenters painters masons foreman and construction workers you may let us know 1 day in advance that how many people are required  ', 0),
(9, 'node', ' laptop computer amc repair other services fed up of picking your cpu laptop and wasting your time taking it to nehru place leave it there we will come pick it up and return it safely at your doorstep post repair  ', 0),
(10, 'node', ' printing books visiting cards leaflets pamphlets calendars diaries marriage cards etc we have a tie up with reputed printing firms of delhi and all you need to do is to talk to our person and he will take care of everything  ', 0),
(11, 'node', ' typing services thinking of getting your thesis typed relax we have a team of dedicated people who would assist you in typing of your project  ', 0),
(12, 'node', ' event planners weddings receptions and other parties is your daughter getting or you have to throw a small budget party to your school friends all such questions make us worried but now leave it on our team from food beverages veg non veg to decoration from catering to other miscellaneous management our team will take care of all your worries now you just make a list of guests and rest we will be there with you we do not serve porks and alcohol however you will get the entire menu from our representative  ', 0),
(13, 'node', ' car repair service accessories store etc get your car services by trained professionals within an affordable price we will pick your car repair it and return it you don t need to stand in queues with job sheets to get your own car serviced or to even buy an accessory  ', 0),
